import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Linda",
          id: "78y53t54",
        },
        {
          name: "Frank",
          id: "78y761gh",
        },
        {
          name: "Jackie",
          id: "t3728rgf",
        },
        {
          name: "Niggles",
          id: "y738rghf",
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        {this.state.monsters.map(function (niggles) {
          return (
            <div key={niggles.id}>
              <h1>{niggles.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
